import React, { useEffect, useState } from "react";
import "./case.module.scss";

export const Case = props => {
  const [image, setImage] = useState(null);

  useEffect(() => {
    setImage(props.img);
    console.log(image);
  }, []);

  return (
    <a className='case'>
      <img src={require(image)} alt='' />
      <span>{props.title}</span>
    </a>
  );
};
